import React from 'react'
import { useNavigate } from 'react-router-dom';
import NavigateToLink from './NavigateToLink';

const home = "/";
const register = "register";
const login = "login";
const menu = "menu";

function Navbar2() {
    return (
        <div className='navbar'>
            <div className='containerNavbarButtons'>
                <button className="navbarButtons" id="menuAbout" onClick={() => {
                    <NavigateToLink>NavigateToLink(home)</NavigateToLink>
                    NavigateToLink(home)
                    }
                }>About</button>
                <button className="navbarButtons" id="menuRegister" onClick={() => {NavigateToLink(register)}}>Register</button>
                <button className="navbarButtons" id="loginMenu">Login</button>
                <button className="navbarButtons" id="menu">Menu</button>
            </div>
        </div>
    )
}

export default Navbar2;
